import React, { useState } from "react";
import "../styles/appointment_styles.css"; // Add your styles here if needed

const appointmentsData = [
  { doctor: "Dr So and so", date: "11/12/2024 3-4pm", diagnosis: "Diabetes Diagnosis" },
  { doctor: "Dr So and so", date: "11/12/2024 3-4pm", diagnosis: "Diabetes Diagnosis" },
  { doctor: "Dr So and so", date: "11/12/2024 3-4pm", diagnosis: "Diabetes Diagnosis" },
  { doctor: "Dr So and so", date: "11/12/2024 3-4pm", diagnosis: "Diabetes Diagnosis" }
];

function Appointments() {
  return (
    <div className="appointments-container">

      {/* Appointment Section */}
      <section className="appointments-section">
        <h1>Appointments</h1>

        {/* All Appointments Wrapper */}
        <div className="appointments-box">
          
          {/* Upcoming Appointments Group */}
          <div className="appointment-box upcoming">
            <h2>Upcoming</h2>
            <div className="appointment-card-group">
              {appointmentsData.map((appointment, index) => (
                <div className="appointment-item" key={index}>
                  <div className="appointment-details">
                    <h3>{appointment.doctor}</h3>
                    <p>{appointment.date}</p>
                    <p>{appointment.diagnosis}</p>
                  </div>
                  <div className="appointment-actions">
                    <button className="edit-button">Edit</button>
                    <button className="cancel-button">Cancel</button>
                  </div>
                </div>
              ))}
            </div>
          </div>

          {/* Past Appointments Group */}
          <div className="appointment-box past">
            <h2>Past</h2>
            <div className="appointment-card-group">
              {appointmentsData.map((appointment, index) => (
                <div className="appointment-item" key={index}>
                  <div className="appointment-details">
                    <h3>{appointment.doctor}</h3>
                    <p>{appointment.date}</p>
                    <p>{appointment.diagnosis}</p>
                  </div>
                  <div className="appointment-actions">
                    <button className="edit-button">Edit</button>
                    <button className="cancel-button">Cancel</button>
                  </div>
                </div>
              ))}
            </div>
          </div>
        </div>

      </section>
    </div>
  );
}

export default Appointments;
